	function update_DB ($id) {
		$encrypted_id = construct_the_id(QOBUZSERVICE . 'Album', $id);
	
	// GraphQl query begins
		$album_part = <<<ALBUM
		mutation MyMutation {
		  update_music_Tracks(where: {_album_id: {_eq: "$id"}}, _set: {album_id: "$encrypted_id"}) {
			affected_rows
			returning {
			  album_id
			}
		  }
		}
	ALBUM;
	
		$graphql = $album_part;
		$query = graphql_query('http://localhost:6142/v1/graphql', $graphql, MUSIC_GRAPHQL_ADMINPASS, [], null);
		return $query;
	}
